import { Container, withStyles, Typography, Box } from "@material-ui/core";


export const SectionContainer = withStyles({
        root: {
            paddingTop: "32px",
            paddingBottom: "32px",
            margin: '0px',
            maxWidth: '100%'

        },
      })(Container);

export const TopSectionContainer = withStyles({
        root: {
            backgroundImage: "url(/img/header_club_green.png)",
            backgroundRepeat: no-repeat,
            backgroundSize: auto,
            textAlign: 'center'
        },
      })(SectionContainer);

export const FooterSectionContainer = withStyles({
        root: {
            backgroundColor: "#444444",
        },
      })(SectionContainer);     

export const SectionHeader = withStyles({
    root: {
        color: 'gray',
        width: '100%',
        fontSize: '32px',
        paddingBottom: "24px",
        textAlign: 'center'
    },
  })(Typography);

  export const BasicContentBox = withStyles({
    root: {
        width: '90%',
        paddingTop: "16px",
        paddingBottom: "16px",
        margin: "auto"
    },
  })(Box);

  export const WhiteTypo = withStyles(
    {
      root: {
        color: 'white',
        paddingBottom: '16px'
      }

    }
  )(Typography)
